/**
 * N8N Code Node Script: Formats a single JSON object (form submission data)
 * into a clean, multi-line string suitable for a contact's text field.
 * * Updated to remove the header, footer, and 'formMode' entry.
 */
for (const item of items) {
  const data = item.json;
  const lines = []; // Use an array to collect lines

  // Iterate over all key-value pairs in the input data
  for (const key in data) {
    if (Object.hasOwnProperty.call(data, key)) {
      const value = data[key];
      let cleanKey = key;

      // Skip the 'formMode' key as requested
      if (key === 'formMode') {
          continue; 
      }

      // Clean up common metadata keys for better display
      if (key === 'submittedAt') {
          cleanKey = 'Submission Timestamp';
      } else if (key === 'Lead GHL email') {
          cleanKey = 'Lead Email (GHL)';
      }

      // Push the formatted line to the array
      // Using trim() on the key just in case there are trailing spaces in the form names
      lines.push(`${cleanKey.trim()}: ${value}`);
    }
  }

  // Join the array lines with a newline character. 
  // This automatically removes the need for a header/footer or extra newlines.
  const formattedText = lines.join('\n');

  // Attach the final formatted string to the output item under a new property
  // You will use this 'formattedData' property in your HighLevel node
  item.json.formattedData = formattedText;
}

return items;
